INSERT INTO Events (event_id, user_id, name, location, host, start_time, end_time, description, timestamp) VALUES
    ('1', '1', 'Halloween Party', 'Sylvan Grove', 'COM²', '2023-10-31 21:00:00', '2023-11-01 03:00:00', 'Join us if you dare for a night that''s sure to scare! Our Halloween Party is brewing with excitement and fright. Get ready to step into a world where ghouls roam and witches fly under the moonlit sky.', '2022-01-01 01:00:00'),
    ('2', '6', 'Thanksgiving Dinner', 'CSE1 Jaech Lounge', 'CSE Operations', '2023-11-23 16:30:00', '2023-11-24 02:00:00', 'Gather around our table this Thanksgiving for an evening filled with warmth, gratitude, and delicious flavors. Join us for a heartwarming celebration as we give thanks for the blessings of the past year and the joy of being together.', '2022-01-01 02:00:00'),
    ('3', '1', 'Talent Show', 'Kane Hall', 'SAC', '2023-12-12 09:00:00', '2023-12-12 13:00:00', 'Celebrate the diverse and extraordinary talents within our university community! Whether you''re a singer, dancer, musician, magician, or have a unique skill to share, this stage is for you!', '2022-01-01 04:00:00'),
    ('4', '6', 'Resume Workshop & Review', 'CSE1 Student Commons', 'CSE Advising', '2023-12-15 16:00:00', '2023-12-15 18:00:00', 'Elevate your first step into the professional world with our resume workshop specifically designed to guide you in crafting a resume that showcases your academic achievements and extracurricular experiences in a way that appeals to today''s employers.', '2022-01-01 03:00:00'),
    ('5', '1', 'CSE154 Student Presentations', 'Nano-Engineering Building', 'CSE154 Staff', '2023-12-12 08:30:00', '2023-12-12 10:00:00', 'Join us for an inspriring display of talent and innovation at the CSE154 Student Presentations! This event features our students as they present their cutting-projects. Come give them your support!', '2022-01-01 05:00:00'),
    ('6', '6', 'New Years Eve Party', 'CSE1 Atrium', 'Alba', '2023-12-31 21:00:00', '2024-01-01 01:00:00', 'Join us for a night filled with glitter, glamour, and unforgettable memories as we watch the ball drop. It''s more than just a party; it''s the start of a brand new year!', '2022-01-01 06:00:00');
